import React from "react";
import movies from "../movies"
import Movie from "./Movie"
function App(){
  {movies.map((data) =>{
        return(
            <Movie 
            title={data.title}
             poster={data.poster} 
             genre={data.genre}
             />
        );
    });}
}

export default App
